import React from 'react';
import { Typography } from '@material-tailwind/react';

const Home = () => {
    return (
     
        <div>
        <div style={{ backgroundImage: `url(${image})`, height: '300px', backgroundSize: 'cover', backgroundPosition: 'center' }}></div>
        <div>
          <h1>Bienvenue sur mon site !</h1>
          <p>Voici le contenu de mon site.</p>
        </div>
      </div>
    );
    }

export default Home;
